      <h1 className="game-title">SNAKE</h1>
      <div className="menu">
        <Link to="/play" className="button">
          {" "}
          <p>START</p>
        </Link>
        <Link to="/options" className="button">
          {" "}
          <p>OPTIONS</p>
        </Link>
        <Link to="/about" className="button">
          {" "}
          <p>ABOUT</p>
        </Link>
      </div>
    </div>
  );
}
